    false,nt"url": null,nt"notes": "This Narrative Report for Parker River
    NWR and Great Meadows NWR summarizes refuge activities from May through August of
    1952.  The report begins with general information about the yearu2019s weather conditions,
    water conditions, and fires.  Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predaceous birds, and fish- is also covered.  The
    report includes a refuge development and maintenance section which discusses physical
    developments, plantings, collections, and receipts of seeds.  Economic uses of the
    refuge are outlined; cabin rental was the primary use.   A progress report on field
    investigations is included.  The public relations section of the report discusses
    public uses of the refuge, refuge visitors, refuge participation, hunting, fishing,
    and violations.  Summaries are given for Great Meadows Refuge and Widowu2019s Island.
     Finally, items of interest, photographs, and N-R forms are provided.",nt"owner_org":
